const url = "http://localhost/cacc_backend/api/";
const config = {
    headers: {
        'Content-Type': 'application/json',
        'Authorization': "Bearer " + getValidToken()
    }
};

function getValidToken() {
    return localStorage.getItem('validToken');
}

export {url, config};
